var $, calculateScore, centerModal, getCurrentScore, gotoNextQuestion, gotoPage, hideHiddenElements, init, preloadSound, requestAnimFrame, reset, setImagePopovers, setScore, totalAswers;

global.$ = global.jQuery = $ = require("jquery");

requestAnimFrame = require("animationframe");

require("./preloadjs-0.6.2.min");

require("./soundjs-0.6.2.min");

require("bootstrap/assets/javascripts/bootstrap/transition");

require("bootstrap/assets/javascripts/bootstrap/tooltip");

require("bootstrap/assets/javascripts/bootstrap/popover");

require("bootstrap/assets/javascripts/bootstrap/modal");

init = function() {
  $(window).bind('resize', function() {
    return setImagePopovers();
  });
  $('.home .btn').bind('click', function() {
    return gotoPage($('.home.page'), $('.quiz.page'));
  });
  $('#successModal .btn.save-button').bind('click', function() {
    $('#successModal').modal('hide');
    return gotoNextQuestion($('.question-container.active'));
  });
  $('#errorModal .btn.save-button').bind('click', function() {
    return $('#errorModal').modal('hide');
  });
  $('#finishModal .btn.save-button').bind('click', function() {
    reset();
    return gotoPage($('.quiz.page'), $('.home.page'));
  });
  $('.quiz .answers a').bind('click', function() {
    var modal;
    $('.answers a').popover('hide');
    if ($(this).data('isCorrect')) {
      $('.question-container.active .answers a').addClass('disabled');
      $(this).addClass('success');
      setScore();
    } else {
      $(this).addClass('error').addClass('disabled');
    }
    modal = $(this).data('isCorrect') ? $('#successModal') : $('#errorModal');
    if ($(this).data('isCorrect') && $('.question-container.active').next().length === 0) {
      modal = $('#finishModal');
      modal.find('.modal-body').html($(this).data('description') + '<br><hr><br>' + $('.quiz.page').data('endGameMessage'));
      setScore();
    } else {
      modal.find('.modal-body').html($(this).data('description'));
    }
    if ($(this).data('isCorrect')) {
      $('.current-score').html("+" + (getCurrentScore()));
      $('.current-score').addClass('visible').removeClass('hidden');
      createjs.Sound.play("success");
      return setTimeout(function() {
        modal.modal('show');
        centerModal(modal, $('.page.active'));
        return $('.current-score').removeClass('visible').addClass('hidden');
      }, 1000);
    } else {
      modal.modal('show');
      return centerModal(modal, $('.page.active'));
    }
  });
  preloadSound();
  setImagePopovers();
  hideHiddenElements();
  return setScore();
};

setImagePopovers = function() {
  if ($(window).width() > 991) {
    return $('.answers a').popover({
      delay: {
        "show": 500,
        "hide": 100
      },
      animation: true,
      html: true,
      trigger: "hover",
      container: "body",
      placement: "right"
    });
  } else {
    return $('.answers a').popover('destroy');
  }
};

hideHiddenElements = function() {
  $('.page').each(function() {
    if (!$(this).hasClass('active')) {
      return $(this).css('display', 'none');
    }
  });
  return $('.question-container').each(function() {
    if (!$(this).hasClass('active')) {
      return $(this).css('display', 'none');
    }
  });
};

reset = function() {
  $('.answers a').popover('hide');
  $('.modal').modal('hide');
  $('.page').each(function() {
    return $(this).attr('style', '');
  });
  $('.question-container.active').removeClass('active');
  $('.question-container').first().addClass('active');
  $('.question-container').each(function() {
    return $(this).attr('style', '');
  });
  $('.quiz .answers a').each(function() {
    $(this).removeClass('disabled').removeClass('success').removeClass('error');
    return $(this).attr('style', '');
  });
  setScore();
  return hideHiddenElements();
};

gotoPage = function(activePage, nextPage) {
  if (nextPage.length === 0 || activePage.length === 0) {
    return;
  }
  nextPage.attr('style', '');
  nextPage.css('display', 'block');
  return setTimeout(function() {
    activePage.attr('style', '');
    activePage.removeClass('active');
    activePage.css('top', '-100%');
    nextPage.addClass('active');
    return setTimeout(function() {
      return activePage.css('display', 'none');
    }, 1000);
  }, 50);
};

gotoNextQuestion = function(activeQuestion) {
  if (activeQuestion.next().length === 0) {
    return;
  }
  activeQuestion.next().css('display', 'block');
  $('.answers a').popover('hide');
  return setTimeout(function() {
    activeQuestion.removeClass('active');
    activeQuestion.css('left', '-100%');
    activeQuestion.next().addClass('active');
    return setTimeout(function() {
      return activeQuestion.css('display', 'none');
    }, 1000);
  }, 50);
};

centerModal = function(modal, element) {
  return setTimeout(function() {
    var dialog;
    dialog = modal.find('.modal-dialog');
    return dialog.css('transform', "translate(0, " + ((element.height() - dialog.height()) / 2) + "px)");
  }, 150);
};

getCurrentScore = function() {
  return $('.question-container.active .answers a').length - $('.question-container.active .answers a.error').length;
};

calculateScore = function() {
  var score;
  score = 0;
  $('.question-container').each(function() {
    var errorAnswers, totalAnswers;
    if ($(this).find('.answers a.success').length > 0) {
      totalAnswers = $(this).find('.answers a').length;
      errorAnswers = $(this).find('.answers a.error').length;
      return score += totalAnswers - errorAnswers;
    }
  });
  return score;
};

preloadSound = function() {
  var queue;
  queue = new createjs.LoadQueue();
  queue.installPlugin(createjs.Sound);
  return queue.loadManifest([
    {
      id: "success",
      src: SUCCESS_SOUND
    }
  ]);
};

totalAswers = function() {
  return $('.question-container .answers a').length;
};

setScore = function() {
  return $('.score-value').html((calculateScore()) + " / " + (totalAswers()));
};

init();


